CREATE TABLE users (
  id SERIAL PRIMARY KEY,
  first text,
  last text,
  username text,
  password text,
  vtype1 text,
  vtype2 text,
  vtype3 text,
  stype1 text,
  stype2 text,
  stype3 text,
  gender text,
  bday_day integer,
  bday_month text,
  bday_year integer,
  auth0 text,
  email text
);


CREATE TABLE venues (
  id SERIAL PRIMARY KEY,
  name text,
  street text,
  city text,
  state text,
  zipcode text,
  phone text,
  web text,
  vtype1 text,
  vtype2 text,
  vtype3 text,
  stype1 text,
  stype2 text,
  stype3 text,
  lat numeric,
  long numeric,
  capacity text,
  pic1 text,
  pic2 text,
  pic3 text
);



SELECT pg_catalog.setval(pg_get_serial_sequence('venues', 'id'), (SELECT MAX(id) FROM venues)+1);
